import React from 'react';
import { useContext } from "react";
import About from "./components/beachdetail/about/About";
import Contact from "./components/beachdetail/contact/Contact";
import Intro from "./components/beachdetail/intro/Intro";
import ProductList from "./components/beachdetail/productList/ProductList";
import Toggle from "./components/beachdetail/toggle/Toggle";
import { ThemeContext } from "./components/beachdetail/context";
import '../../App.css';

const BeachDetail = () => {
  const theme = useContext(ThemeContext);
  const darkMode = theme.state.darkMode;
  return (
    <div
      style={{
        backgroundColor: darkMode ? "#222" : "white",
        color: darkMode && "white",
      }}
    >
      <Intro />
      <About />
      <ProductList />
      <Contact />
    </div>
  );
};

export default BeachDetail;
